const Post = ({key, user, title, text}) => {

    const openPost = (e) => {
        window.location.href = "/post/" + key;
    }

    return (
        // I know this is weird
        <div className="post" onClick={openPost}>
            <p>user: {user}</p>
            <h4>{title}</h4>
            <p>{text}</p>
            <p>{key}s</p>
        </div>
    )
}

export default Post;
